%[text] # Slicer Volume Visualization - CTACardio Segmentations
%[text] In this module, we will load the CTACardio volume and segmentations that we created in Slicer.  Remember, segmentation files are label maps that have the same dimensions as the original volume, but have labels (numbers) instead of intensity values. There is a label value for each structure segmented from the original file. So, if there four structures segmented, there will be 4 labels in the volume (labels 1-4).
%[text] **File Extension Conventions:** In Slicer, intensity files are saved as **\*.nrrd files**, while segmentation files are saved as **\*.seg.nrrd files**
%[text] **IMPORTANT**
%[text] - Create a new folder in your MATLAB drive called MedImaging
%[text] - Copy this File to the MedImaging folder  \
%%
clearvars
close all
setupMatGeom %[output:814dc123]
%%
%[text] ## Set Folder path
%[text] - Review the name of your Crop Volume: Is it "CTACardio Crop.nrrd"?
%[text] - If you are using your folder, **update the** **`segment`** **path** to contain your last name
%[text] - Select your CTACardio folder. If you don't have one yet, you can choose the CTACardio folder in the unit3 folder. \
paths.project = "/Users/ernesto/MATLAB-Drive/MtMdata/unit3/CTACardio"; %[control:filebrowser:3f76]{"position":[17,70]}
ls(paths.project) % display folder contents %[output:6cf76cb3]
paths.intensity = fullfile(paths.project,"CTACardio Crop.nrrd");
paths.segment = fullfile(paths.project,"Salcedo Segmentation.seg.nrrd") %[output:06b9e275]
%[text] path check
structfun(@(x) exist(x,"file"),paths) % make sure paths exist - a zero mean the indicated file does not exist %[output:63439cbb]
%%
%[text] ## Load Volumes
%[text] ### Load the intensity volume
mVint = medicalVolume(paths.intensity) %[output:64b5f9ac]
%[text] - notice that Voxels here is a structure (not a volume) \
%%
%[text] ### Load the segmentation volume
mVseg = medicalVolume(paths.segment) %[output:28e0e764] %[output:9492085d]
%[text] - same deal with the Segmentation Data \
%%
%[text] ### Visualize a Intensity Segmentation Overlay
%[text] We can overlay the segmentation of the intensity values using `volshow` as follows:
hvr3 = viewer3d(BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient %[output:2b8ff6ff]
%[text] - The function **`viewer3d`** is like `figure`, but for `volshow`.
%[text] - Nothing plots yet, but we set the properties of  the figure, like background \
volshow(mVint,Parent=hvr3, ...
    RenderingStyle="GradientOpacity", ... % makes intensity volume transparent
    OverlayData=mVseg.Voxels) % add Segmentations
%[text] - volshow actually displays the volumes \
%[text] - right-click on image to add a scale bar
%[text] - right-click on image to save a screenshot to file \
%%
%[text] ### Use Slicer colors
%[text] The .SEG.NRRD file includes the segmentation information that you saved in Slicer. The following function loads that data
segT = mmGetSlicerSegTable(paths.segment) %[output:2a130be2]
%%
%[text] ### Volume transformation
%[text] medicalVolume objects contain both a **Voxels** field, which is the actual volume (typically a 3D array), and a VolumeGeometry field, which contains the transformation information necessary to arrange the voxel data in 3D space. The function **`instrinsicToWorldMapping`** converts that field into a affine transformation matrix. 
tform = intrinsicToWorldMapping(mVseg.VolumeGeometry) % create transformation matrix (scale, rotate, translate) %[output:7245e76c]
%[text] - tform can be used to apply an affine transformation to the volume \
%%
%[text] ### Plot Segmentations as Surfaces
%[text] volshow renders the volumes. But if we want to create a surface, we need to use `isosurface`. The course function **`mmPlotMask2Surface`** creates a surface from a mask using isosurface
%[text] ### Plot Aorta
figure %[output:6076b997]
lval = 3; % set label that you want to plot
MASK = mVseg.Voxels == lval; % Create mask
hp = mmPlotMask2Surface(MASK,... %[output:group:266d7874] %[output:6076b997]
    fcolor=segT.Color(lval,:),... %[output:6076b997]
   affTrfm=tform.A); % apply transformation %[output:group:266d7874] %[output:6076b997]
%%
%[text] The function returns the handle to the surface
hp %[output:5ff96991]
%%
%[text] ### Plot all Segmentations
figure; %[output:20bf84c4]
hp = mmPlotAllSeg(mVseg,segT) %[output:20bf84c4] %[output:46ef9dad]
%%
%[text] ## Region Properties
%[text] We can easily capture the region properties of our segments. First, we convert to a categorical, to clearly label our properties. Notice how we can use the data from the segT table to properly convert the volume to a categorical volume.
segCat = categorical(mVseg.Voxels,segT.LabelValue,segT.SegName);
rp = regionprops3(segCat,'Volume') %[output:79b34d2a]
%%
%[text] Convert to mm
rp.VolumeMM = rp.Volume * prod(mVseg.VoxelSpacing) %[output:6667cbeb]

